script: |
  super -f text -I q13459.spq | sort > q13459.out

inputs:
  - name: q13459.spq
    data: |
      SELECT ALL + - col2, + col1 AS col1 FROM tab1 (FORMAT parquet) WHERE - - col1 NOT BETWEEN col2 AND + + CAST ( + col0 AS INTEGER ) * col2 * - + 41;
  - name: tab1

outputs:
  - name: q13459.out
    data: |
      -59	5
      -68	47
      -96	14
